import React from 'react'
import kulaklik from "../logo/kulaklik.jpg"
import oyuncukoltugu from "../logo/oyuncukoltugu.jpg"
import bilgisayar from "../logo/bilgisayar.jpg"
import araba from "../logo/araba.jpg"
import ucakk from "../logo/ucakk.jpg"
import s400 from "../logo/s400.jpg"

export const SomeDatax = [
    {
        title:"Kulaklık",
        link: "/Kulaklik",
        icon: <img alt="" style={{height:"100px",width:"100px"}} src={kulaklik}></img>
    },
    {
        title:"Oyuncu Koltugu",
        link: "/Oyuncu_Koltugu",
        icon: <img alt="" style={{height:"100px",width:"100px"}} src={oyuncukoltugu}></img>
    },
    {
        title:"Bilgisayar",
        link: "/Bilgisayar",
        icon: <img alt="" style={{height:"100px",width:"100px"}} src={bilgisayar}></img>
    },
    {
        title:"Araba",
        link: "/Araba",
        icon: <img alt="" style={{height:"100px",width:"100px"}} src={araba}></img>
    },
    {
        title:"Uçak",
        link: "/Ucak",
        icon: <img alt="" style={{height:"100px",width:"100px"}} src={ucakk}></img>
    },
    {
        title:"S400",
        link: "/S400",
        icon: <img alt="" style={{height:"100px",width:"100px"}} src={s400}></img>
    },
]
